subroutine derivs(x,y,dydx)
!Calculating the right hand side of differential equations

  implicit none

  integer NMAX !maximal number of differential equations
  parameter(NMAX=50)
  real(8) x,y(NMAX),dydx(NMAX)
  integer N_str(4) !store the structure of functions of ODE
  integer Nv,Nh,Nz,Nck
  real(8) k ! IR cutoff in flow equations
  real(8) lam0,lam1,lam2,lam3,lam4,lam5,lam6,lam7
  real(8) h
  real(8) Zphi,Zpsi
  real(8) c,kappa
  real(8) pi,hc
  parameter(pi=3.1415926)
  parameter(hc=197.33)
  real(8) etaphi,etapsi
!meson and quark anomanous dimension
  real(8) Nc,Nf
  parameter(Nc=3.,Nf=2.)
  real(8) v3
  parameter(v3=1./(2.*pi**2))
  real(8) rho !phi_a**2/2
  real(8) Fnb,Fnf0,Fnf1,Fnf2
  external Fnb,Fnf0,Fnf1,Fnf2
  real(8) zb,zf !distinguish the transverse and longituidanl wave function renormalization
  real(8) p0,p0c !temporal compontent of external momentum
  real(8) T,mu
  real(8) mu0
  real(8) l,lb !polyakov loop
  real(8) k_UV,k_IR,t_UV,t_IR
  real(8) mp2,ms2,mf2,mp2d1rho,mp2d2rho,mp2d3rho,mp2d4rho,mp2d5rho,ms2d1rho,ms2d2rho,ms2d3rho,ms2d4rho,ms2d5rho,mf2d1rho
  real(8) mf2d2rho,mf2d3rho,mf2d4rho,mf2d5rho
  real(8) nb,nbd0x,nbd1x,nbd2x,nbd3x,nbd4x,nbd5x,nbd6x
  real(8) nbPion,nbd1xPion,nbd2xPion,nbd3xPion,nbd4xPion,nbd5xPion,nbSigma,nbd1xSigma,nbd2xSigma, &
          nbd3xSigma,nbd4xSigma,nbd5xSigma,nbd6xPion,nbd6xSigma
  real(8) nff,nfd1xf,nfd2xf,nfd3xf,nfd4xf,nfd5xf,nfd6xf,nfa,nfd1xa,nfd2xa,nfd3xa,nfd4xa,nfd5xa,nfd6xa
  real(8) nf0,nf1,nf2,nfd0x,nfd1x,nfd2x,nfd3x,nfd4x,nfd5x,nfd6x
  real(8) xff,xfa
  real(8) f2a,f3a,b2b2PS,b2f1aPion,b2f1aPionI,b2f1aSigma,b2f1aSigmaI,b1f2Pion,b1f2PionI,b1f2Sigma,b1f2SigmaI
  complex(8) b2f1aPionC,b2f1aSigmaC,b1f2PionC,b1f2SigmaC
  real(8) dr0dtV,dr1dtV,dr2dtV,dr3dtV,dr4dtV,dr5dtV,dr0dth,dr1dth,dr2dth,dr3dth,dr4dth,dr5dth
  real(8) dlam0dt,dlam1dt,dlam2dt,dlam3dt,dlam4dt,dlam5dt,dlam6dt,dlam7dt
  real(8) L11Pion,L11Sigma,L12Pion,L12Sigma,L13Pion,L13Sigma,L21Pion,L21Sigma,L22Pion,L22Sigma,L31Pion,L31Sigma
  real(8) l1B4Pion,l1B4Sigma,l2B4Pion,l2B4Sigma,l3B4Pion,l3B4Sigma
  real(8) dr1dh,dr2dh,dr3dh,dr4dh,dr5dh
  real(8) dZphidt,dZpsidt,dcdt,dkappadt
  real(8) l_com,lb_com
!  complex(8) b1f3PionC,b1f3SigmaC,b1f4PionC,b1f4SigmaC,b2f2PionC,b2f2SigmaC,b2f3PionC,b2f3SigmaC,b3f2PionC,b3f2SigmaC
!  real(8) b1f3Pion,b1f3Sigma,b1f4Pion,b1f4Sigma,b2f2Pion,b2f2Sigma,b2f3Pion,b2f3Sigma,b3f2Pion,b3f2Sigma
!  complex(8) b2f2aPionC,b2f2aSigmaC,b2f3aPionC,b2f3aSigmaC,b3f1aPionC,b3f1aSigmaC,b3f2aPionC,b3f2aSigmaC,b4f1aPionC,b4f1aSigmaC
!  real(8) b2f2aPion,b2f2aSigma,b2f3aPion,b2f3aSigma,b3f1aPion,b3f1aSigma,b3f2aPion,b3f2aSigma,b4f1aPion,b4f1aSigma
  complex(8) b1f3Pionc,b1f3Sigmac,b1f4Pionc,b1f4Sigmac,b2f2Pionc,b2f2Sigmac,b3f2Pionc,b3f2Sigmac,b2f3Pionc,b2f3Sigmac,b1f5Pionc
  complex(8) b1f5Sigmac,b4f2Pionc,b4f2Sigmac,b2f4Pionc,b2f4Sigmac,b3f3Pionc,b3f3Sigmac,b2f5Pionc,b2f5Sigmac,b4f3Pionc,b4f3Sigmac
  complex(8) b3f4Pionc,b3f4Sigmac,b1f6Pionc,b1f6Sigmac,b5f2Pionc,b5f2Sigmac,b2f6Pionc,b2f6Sigmac,b5f3Pionc,b5f3Sigmac,b3f5Pionc
  complex(8) b3f5Sigmac,b4f4Pionc,b4f4Sigmac,b6f2Pionc,b6f2Sigmac,b1f7Pionc,b1f7Sigmac,b2f2aPionc,b2f2aSigmac,b3f1aPionc,b3f1aSigmac
  complex(8) b4f1aPionc,b4f1aSigmac,b3f2aPionc,b3f2aSigmac,b2f3aPionc,b2f3aSigmac,b2f4aPionc,b2f4aSigmac,b5f1aPionc,b5f1aSigmac
  complex(8) b3f3aPionc,b3f3aSigmac,b4f2aPionc,b4f2aSigmac,b3f4aPionc,b3f4aSigmac,b5f2aPionc,b5f2aSigmac,b4f3aPionc,b4f3aSigmac
  complex(8) b2f5aPionc,b2f5aSigmac,b6f1aPionc,b6f1aSigmac,b3f5aPionc,b3f5aSigmac,b6f2aPionc,b6f2aSigmac,b4f4aPionc,b4f4aSigmac
  complex(8) b5f3aPionc,b5f3aSigmac,b7f1aPionc,b7f1aSigmac,b2f6aPionc,b2f6aSigmac
  real(8) b1f3Pion,b1f3Sigma,b1f4Pion,b1f4Sigma,b2f2Pion,b2f2Sigma,b3f2Pion,b3f2Sigma,b2f3Pion,b2f3Sigma,b1f5Pion
  real(8) b1f5Sigma,b4f2Pion,b4f2Sigma,b2f4Pion,b2f4Sigma,b3f3Pion,b3f3Sigma,b2f5Pion,b2f5Sigma,b4f3Pion,b4f3Sigma
  real(8) b3f4Pion,b3f4Sigma,b1f6Pion,b1f6Sigma,b5f2Pion,b5f2Sigma,b2f6Pion,b2f6Sigma,b5f3Pion,b5f3Sigma,b3f5Pion
  real(8) b3f5Sigma,b4f4Pion,b4f4Sigma,b6f2Pion,b6f2Sigma,b1f7Pion,b1f7Sigma,b2f2aPion,b2f2aSigma,b3f1aPion,b3f1aSigma
  real(8) b4f1aPion,b4f1aSigma,b3f2aPion,b3f2aSigma,b2f3aPion,b2f3aSigma,b2f4aPion,b2f4aSigma,b5f1aPion,b5f1aSigma
  real(8) b3f3aPion,b3f3aSigma,b4f2aPion,b4f2aSigma,b3f4aPion,b3f4aSigma,b5f2aPion,b5f2aSigma,b4f3aPion,b4f3aSigma
  real(8) b2f5aPion,b2f5aSigma,b6f1aPion,b6f1aSigma,b3f5aPion,b3f5aSigma,b6f2aPion,b6f2aSigma,b4f4aPion,b4f4aSigma
  real(8) b5f3aPion,b5f3aSigma,b7f1aPion,b7f1aSigma,b2f6aPion,b2f6aSigma
  real(8) L14Pion,L14Sigma,L41Pion,L41Sigma,L23Pion,L23Sigma,L32Pion,L32Sigma
  real(8) L24Pion,L24Sigma,L42Pion,L42Sigma,L33Pion,L33Sigma,L15Pion,L15Sigma
  real(8) L51Pion,L51Sigma,L25Pion,L25Sigma,L52Pion,L52Sigma,L34Pion,L34Sigma
  real(8) L43Pion,L43Sigma,L61Pion,L61Sigma,L16Pion,L16Sigma
  real(8) l4B4Pion,l4B4Sigma,l5B4Pion,l5B4Sigma,l6B4Pion,l6B4Sigma

  common /strucFun/ N_str
  common /Tmu/ T,mu
  common /kRange/k_UV,k_IR,t_UV,t_IR
  common /polyakov_com/ l_com,lb_com



  Nv=N_str(1)
  Nh=N_str(2)
  Nz=N_str(3)
  Nck=N_str(4)

  k=k_UV*exp(x)
  lam1=y(1)
  lam2=y(2)
  lam3=y(3)
  lam4=y(4)
  lam5=y(5)
  lam6=y(6)
  lam7=y(7)
  lam0=y(Nv+1)
  h=y((Nv+1)+1)
  dr1dh=y((Nv+1)+2)
  dr2dh=y((Nv+1)+3)
  dr3dh=y((Nv+1)+4)
  dr4dh=y((Nv+1)+5)
  dr5dh=y((Nv+1)+6)
  Zphi=y((Nv+1)+(Nh+1)+1)
  Zpsi=y((Nv+1)+(Nh+1)+2)
  c=y((Nv+1)+(Nh+1)+Nz+1)
  kappa=y((Nv+1)+(Nh+1)+Nz+2)


  rho=kappa !calculations are performed at expansion point kappa

  zb=1.
  zf=1.


  mu0=0.

!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
!mass and their derivatives
  mp2=lam1/k**2

  ms2=(lam1 + 2*lam2*rho)/k**2

  mf2=(h**2*rho)/(k**2*Nf)

  mp2d1rho=lam2/k**2

  mp2d2rho=lam3/k**2

  mp2d3rho=lam4/k**2

  mp2d4rho=lam5/k**2

  mp2d5rho=lam6/k**2

  ms2d1rho=(3*lam2 + 2*lam3*rho)/k**2

  ms2d2rho=(5*lam3 + 2*lam4*rho)/k**2

  ms2d3rho=(7*lam4 + 2*lam5*rho)/k**2

  ms2d4rho=(9*lam5 + 2*lam6*rho)/k**2

  ms2d5rho=(11*lam6 + 2*lam7*rho)/k**2

  mf2d1rho=h**2/(k**2*Nf) + (2*h*dr1dh*rho)/(k**2*Nf)

  mf2d2rho=(4*h*dr1dh)/(k**2*Nf) + (2*dr1dh**2*rho)/(k**2*Nf) + &
  (2*h*dr2dh*rho)/(k**2*Nf)

  mf2d3rho=(6*dr1dh**2)/(k**2*Nf) + (6*h*dr2dh)/(k**2*Nf) + &
  (6*dr1dh*dr2dh*rho)/(k**2*Nf) + (2*h*dr3dh*rho)/(k**2*Nf)

  mf2d4rho=(24*dr1dh*dr2dh)/(k**2*Nf) + (8*h*dr3dh)/(k**2*Nf) + &
  (6*dr2dh**2*rho)/(k**2*Nf) + (8*dr1dh*dr3dh*rho)/(k**2*Nf) + &
  (2*h*dr4dh*rho)/(k**2*Nf)

  mf2d5rho=(30*dr2dh**2)/(k**2*Nf) + (40*dr1dh*dr3dh)/(k**2*Nf) + &
  (10*h*dr4dh)/(k**2*Nf) + (20*dr2dh*dr3dh*rho)/(k**2*Nf) + &
  (10*dr1dh*dr4dh*rho)/(k**2*Nf) + (2*h*dr5dh*rho)/(k**2*Nf)


!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!

  nb=Fnb((k*Sqrt(1 + mp2))/Sqrt(zb),T)
  call nbdx(nb,nbd0x,nbd1x,nbd2x,nbd3x,nbd4x,nbd5x,nbd6x)
  nbPion=nbd0x
  nbd1xPion=nbd1x
  nbd2xPion=nbd2x
  nbd3xPion=nbd3x
  nbd4xPion=nbd4x
  nbd5xPion=nbd5x
  nbd6xPion=nbd6x

  nb=Fnb((k*Sqrt(1 + ms2))/Sqrt(zb),T)
  call nbdx(nb,nbd0x,nbd1x,nbd2x,nbd3x,nbd4x,nbd5x,nbd6x)
  nbSigma=nbd0x
  nbd1xSigma=nbd1x
  nbd2xSigma=nbd2x
  nbd3xSigma=nbd3x
  nbd4xSigma=nbd4x
  nbd5xSigma=nbd5x
  nbd6xSigma=nbd6x

  xff=-mu + (k*Sqrt(1 + mf2))/zf
  xfa=mu + (k*Sqrt(1 + mf2))/zf

  l=l_com
  lb=lb_com

  nf0=Fnf0(xff,T,l,lb)
  nf1=Fnf1(xff,T,l,lb)
  nf2=Fnf2(xff,T,l,lb)
  call nfdx(l,lb,nf0,nf1,nf2,nfd0x,nfd1x,nfd2x,nfd3x,nfd4x,nfd5x,nfd6x)
  nff=nfd0x
  nfd1xf=nfd1x
  nfd2xf=nfd2x
  nfd3xf=nfd3x
  nfd4xf=nfd4x
  nfd5xf=nfd5x
  nfd6xf=nfd6x


  nf0=Fnf0(xfa,T,lb,l)
  nf1=Fnf1(xfa,T,lb,l)
  nf2=Fnf2(xfa,T,lb,l)
  call nfdx(lb,l,nf0,nf1,nf2,nfd0x,nfd1x,nfd2x,nfd3x,nfd4x,nfd5x,nfd6x)
  nfa=nfd0x
  nfd1xa=nfd1x
  nfd2xa=nfd2x
  nfd3xa=nfd3x
  nfd4xa=nfd4x
  nfd5xa=nfd5x
  nfd6xa=nfd6x

  f2a=(k*Sqrt(1 + mf2)*nfd1xa + k*Sqrt(1 + mf2)*nfd1xf + zf - nfa*zf - nff*zf)/ &
  (4.*(1 + mf2)**1.5*zf**2)

  f3a=(-((k**2*(1 + mf2)*(nfd2xa + nfd2xf))/zf) +                               &
    3*(k*Sqrt(1 + mf2)*nfd1xa + k*Sqrt(1 + mf2)*nfd1xf + zf - nfa*zf -          &
       nff*zf))/(16.*(1 + mf2)**2.5*zf**2)

  b2b2PS=-((-2*(1 + 2*nbPion))/(Sqrt(1 + mp2)*(mp2 - ms2)**3) -                 &
     (1 + 2*nbPion)/(2.*(1 + mp2)**1.5*(mp2 - ms2)**2) -                        &
     (2*(1 + 2*nbSigma))/(Sqrt(1 + ms2)*(-mp2 + ms2)**3) -                      &
     (1 + 2*nbSigma)/(2.*(1 + ms2)**1.5*(-mp2 + ms2)**2) +                      &
     (k*nbd1xPion)/((1 + mp2)*(mp2 - ms2)**2*Sqrt(zb)) +                        &
     (k*nbd1xSigma)/((1 + ms2)*(-mp2 + ms2)**2*Sqrt(zb)))/(2.*Sqrt(zb))



!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
  p0=pi*T
  p0c=sqrt((pi*(T-1./hc)*exp(-k/T/5.)+pi*1./hc)**2+k**2)
  !p0=p0c
  b2f1aPionC=-(k**2*(-((k*nbPion*(-mu0 + Complex(0,1)*p0 - (k*Sqrt(1 + mp2))/Sqrt(zb)))/  &
          ((1 + mp2)*((-mu0 + Complex(0,1)*p0 -                                 &
                  (k*Sqrt(1 + mp2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)      &
**2)) - (k*nbd1xPion)/                                                          &
        (2.*(1 + mp2)*((-mu0 + Complex(0,1)*p0 -                                &
               (k*Sqrt(1 + mp2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)) +      &
       (nbPion*Sqrt(zb))/                                                       &
        (2.*(1 + mp2)**1.5*((-mu0 + Complex(0,1)*p0 -                           &
               (k*Sqrt(1 + mp2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)) -      &
       (k*(-mu0 + Complex(0,1)*p0c - (k*Sqrt(1 + mp2))/Sqrt(zb)))/              &
        ((1 + mp2)*((-mu0 + Complex(0,1)*p0c -                                  &
                (k*Sqrt(1 + mp2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)**2     &
) + Sqrt(zb)/(2.*(1 + mp2)**1.5*                                                &
          ((-mu0 + Complex(0,1)*p0c - (k*Sqrt(1 + mp2))/Sqrt(zb))**2 -          &
            (k**2*(1 + mf2))/zf**2)) +                                          &
       (k*nbPion*(-mu0 + Complex(0,1)*p0 + (k*Sqrt(1 + mp2))/Sqrt(zb)))/        &
        ((1 + mp2)*((-mu0 + Complex(0,1)*p0 +                                   &
                (k*Sqrt(1 + mp2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)**2     &
) - (k*nbd1xPion)/                                                              &
        (2.*(1 + mp2)*((-mu0 + Complex(0,1)*p0 +                                &
               (k*Sqrt(1 + mp2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)) +      &
       (nbPion*Sqrt(zb))/                                                       &
        (2.*(1 + mp2)**1.5*((-mu0 + Complex(0,1)*p0 +                           &
               (k*Sqrt(1 + mp2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)) -      &
       (k**2*zf)/                                                               &
        (Sqrt(1 + mf2)*zb*(-((k**2*(1 + mp2))/zb) +                             &
             (-mu0 + Complex(0,1)*p0c + (k*Sqrt(1 + mf2))/zf)**2)**2) +         &
       ((k**2*nfa*zf)/                                                          &
           (Sqrt(1 + mf2)*zb*(-((k**2*(1 + mp2))/zb) +                          &
                (-mu0 + Complex(0,1)*p0 - (k*Sqrt(1 + mf2))/zf)**2)**2) +       &
          (k**2*nff*zf)/                                                        &
           (Sqrt(1 + mf2)*zb*(-((k**2*(1 + mp2))/zb) +                          &
                (mu0 + Complex(0,1)*p0 - (k*Sqrt(1 + mf2))/zf)**2)**2))/2.      &
+ ((k**2*nff*zf)/                                                               &
           (Sqrt(1 + mf2)*zb*(-((k**2*(1 + mp2))/zb) +                          &
                (-mu0 + Complex(0,1)*p0 + (k*Sqrt(1 + mf2))/zf)**2)**2) +       &
          (k**2*nfa*zf)/                                                        &
           (Sqrt(1 + mf2)*zb*(-((k**2*(1 + mp2))/zb) +                          &
                (mu0 + Complex(0,1)*p0 + (k*Sqrt(1 + mf2))/zf)**2)**2))/2.))/   &
  (2.*zb*zf**2)



  b2f1aPion=real(b2f1aPionC)
  b2f1aPionI=aimag(b2f1aPionC)

  b2f1aSigmaC=-(k**2*(-((k*nbSigma*(-mu0 + Complex(0,1)*p0 -                    &
              (k*Sqrt(1 + ms2))/Sqrt(zb)))/                                     &
          ((1 + ms2)*((-mu0 + Complex(0,1)*p0 -                                 &
                  (k*Sqrt(1 + ms2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)      &
**2)) - (k*nbd1xSigma)/                                                         &
        (2.*(1 + ms2)*((-mu0 + Complex(0,1)*p0 -                                &
               (k*Sqrt(1 + ms2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)) +      &
       (nbSigma*Sqrt(zb))/                                                      &
        (2.*(1 + ms2)**1.5*((-mu0 + Complex(0,1)*p0 -                           &
               (k*Sqrt(1 + ms2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)) -      &
       (k*(-mu0 + Complex(0,1)*p0c - (k*Sqrt(1 + ms2))/Sqrt(zb)))/              &
        ((1 + ms2)*((-mu0 + Complex(0,1)*p0c -                                  &
                (k*Sqrt(1 + ms2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)**2     &
) + Sqrt(zb)/(2.*(1 + ms2)**1.5*                                                &
          ((-mu0 + Complex(0,1)*p0c - (k*Sqrt(1 + ms2))/Sqrt(zb))**2 -          &
            (k**2*(1 + mf2))/zf**2)) +                                          &
       (k*nbSigma*(-mu0 + Complex(0,1)*p0 + (k*Sqrt(1 + ms2))/Sqrt(zb)))/       &
        ((1 + ms2)*((-mu0 + Complex(0,1)*p0 +                                   &
                (k*Sqrt(1 + ms2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)**2     &
) - (k*nbd1xSigma)/                                                             &
        (2.*(1 + ms2)*((-mu0 + Complex(0,1)*p0 +                                &
               (k*Sqrt(1 + ms2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)) +      &
       (nbSigma*Sqrt(zb))/                                                      &
        (2.*(1 + ms2)**1.5*((-mu0 + Complex(0,1)*p0 +                           &
               (k*Sqrt(1 + ms2))/Sqrt(zb))**2 - (k**2*(1 + mf2))/zf**2)) -      &
       (k**2*zf)/                                                               &
        (Sqrt(1 + mf2)*zb*(-((k**2*(1 + ms2))/zb) +                             &
             (-mu0 + Complex(0,1)*p0c + (k*Sqrt(1 + mf2))/zf)**2)**2) +         &
       ((k**2*nfa*zf)/                                                          &
           (Sqrt(1 + mf2)*zb*(-((k**2*(1 + ms2))/zb) +                          &
                (-mu0 + Complex(0,1)*p0 - (k*Sqrt(1 + mf2))/zf)**2)**2) +       &
          (k**2*nff*zf)/                                                        &
           (Sqrt(1 + mf2)*zb*(-((k**2*(1 + ms2))/zb) +                          &
                (mu0 + Complex(0,1)*p0 - (k*Sqrt(1 + mf2))/zf)**2)**2))/2.      &
+ ((k**2*nff*zf)/                                                               &
           (Sqrt(1 + mf2)*zb*(-((k**2*(1 + ms2))/zb) +                          &
                (-mu0 + Complex(0,1)*p0 + (k*Sqrt(1 + mf2))/zf)**2)**2) +       &
          (k**2*nfa*zf)/                                                        &
           (Sqrt(1 + mf2)*zb*(-((k**2*(1 + ms2))/zb) +                          &
                (mu0 + Complex(0,1)*p0 + (k*Sqrt(1 + mf2))/zf)**2)**2))/2.))/   &
  (2.*zb*zf**2)


  b2f1aSigma=real(b2f1aSigmaC)
  b2f1aSigmaI=aimag(b2f1aSigmaC)

  b1f2PionC=-(k**2*((k*(-mu0 + Complex(0,1)*p0c + (k*Sqrt(1 + mf2))/zf))/       &
        ((1 + mf2)*(-((k**2*(1 + mp2))/zb) +                                    &
             (-mu0 + Complex(0,1)*p0c + (k*Sqrt(1 + mf2))/zf)**2)**2) -         &
       (k**2*nbPion*Sqrt(zb))/                                                  &
